Привет! Я -Татьяна Лапука, сертифицированный йогатерапевт, автор и организатор путешествий и йога-туров.

Чем я могу быть вам полезной? 

Ко мне обращаются 
- со стрессом и бессонницей, 
- с желанием похудеть,
- избавиться от боли в позвоночнике и суставах. 

Мои классы идеально подойдут для женщин 40+ и для тех, кто хочет поддерживать качество жизни на высоком уровне.

Как практик, я люблю системный подход: не только прочувствовать, но и понять. 

Для меня йога в классе - это осознанная работа с телом, дыханием и вниманием. После класса - это радость и удовлетворение.

15 лет я путешествовала нон стоп по миру, изучая культуру и этнику других народов: перенимала знания, училась, исследовала. На классе часто миксую разные подходы и техники из различных дисциплин.

 На дневных классах у меня вы встретите – легкость и динамику, на вечерних – расслабление и вытяжение. 

Мой девиз: «В здоровом теле – здоровый дух»

Буду рада знакомству и до встрече на классе!

Профильное образование:

2007 – обучающий семинар «Аювердическая терапия», Девид Фроули (Москва, Россия);
2009 - 100 hr Yoga Training, Surinder Singh, India;
2013 – треннинг «The Pathwork Method of Transforming the lower self»,  Eva Pierrakos;
2015 – обучающий курс Ayurvedic massage, 60 hours Ришикеш, Индия;
2018 - 200 hr Yoga Alliance, Rishikesh, India;
2019 – практический курс «Красная таблетка» в Академии смысла, Андрей Курпатов, Спб, Россия;
2020 – практический семинар «Отработка навыков йогатерапии сколиозов»;
2020 – обучающий курс Foundation of Thai massage (Level 1) 30 hours, Москва, Россия;
2021 – обучающий семинар «Йогатерапия инсомнии», Москва, Россия;
2021 – дипломированный учебный курс и профессиональная переподготовка «Инструктор-методист по адаптивной физической культуре и адаптивному спорту», 746 ч., ИТСО, Москва, Россия;
2021 – сертификационно-учебный курс «Йогатерапия», 746 часов, ИТСО, Москва, Россия;
2022 – практический семинар «Отработка техник йогатерапии при болях в верхних конечностях», Москва, Россия;
2022 - практический семинар «Отработка мануальных техник при болях в пояснице и крестце», Москва, Россия.

Вышли две книги, описывающие наши путешествия:
1. Фото-книга "Сакральная Индия. Или невероятные путешествия хоббитов в волшебную страну" Нелли Мартова
2. Эзотерический роман "Карта Шута. Откровения Мистика" Роман Доля
